import Vue from 'vue';

export default Vue.extend({
  name: 'abHeader',
  data: () => ({        
      title : 'header',
      drawer: null,
      items: [
        { title: 'Log In' ,name: 'login'},
        { title: 'Sign Up', name: 'signup'}
      ]
  }),
   methods: {      
      goSignup(){
          this.$router.push("/signup");
      },
      goLogin() {
           this.$router.push("/login");
      },
      goMain() {
        this.$router.push("/abMain");
      }        
  }
});
